package com.problems.hackerrank.algorithms.string.test;

import com.problems.hackerrank.algorithms.string.RichieRich;
import org.junit.Assert;
import org.junit.Test;

import java.io.IOException;
import java.nio.charset.Charset;
import java.nio.charset.StandardCharsets;
import java.nio.file.Files;
import java.nio.file.Paths;

/**
 * Created by Maks on 11/26/2017.
 */
public class RichieRichTest {

    @Test
    public  void test1(){
        RichieRich rr=new RichieRich();
        String s=rr.solve("3943",1);
        Assert.assertEquals("3993",s);
    }

    @Test
    public  void test2(){
        RichieRich rr=new RichieRich();
        String s=rr.solve("3991",1);
        Assert.assertEquals("3993",s);
    }

    @Test
    public  void test3(){
        RichieRich rr=new RichieRich();
        String s=rr.solve("1221",2);
        Assert.assertEquals("9229",s);
    }

    @Test
    public  void test4(){
        RichieRich rr=new RichieRich();
        String s=rr.solve("092282",3);
        Assert.assertEquals("992299",s);
    }

    @Test
    public  void test5(){
        RichieRich rr=new RichieRich();
        String input="";
        String s=rr.solve(input,50356);
        String expOut="";
        Assert.assertEquals(expOut,s);
    }

    @Test
    public  void test6(){
        RichieRich rr=new RichieRich();
        String s=rr.solve("3943",4);
        Assert.assertEquals("9999",s);
    }

    @Test
    public  void test7(){
        RichieRich rr=new RichieRich();
        String s=rr.solve("12321",1);
        Assert.assertEquals("12921",s);
    }

    @Test
    public  void test9(){
        RichieRich rr=new RichieRich();
        String input="";
        String s=rr.solve(input,79655);
        String output="";
        Assert.assertEquals(output,s);
    }


    @Test
    public  void test10(){
        RichieRich rr=new RichieRich();
        try {
            String input=readFile("E:/tmp/input.txt", StandardCharsets.UTF_8);
            String s=rr.solve(input,58343);
            String output=readFile("E:/tmp/output.txt", StandardCharsets.UTF_8);
            for(int i=0; i<output.length(); i++){
                if(output.charAt(i)!=s.charAt(i)){
                    System.out.print(i+" ");
                }
            }
            Assert.assertEquals(output,s);

        }
        catch (Exception ex){

        }
    }

    @Test
    public  void test11(){
        RichieRich rr=new RichieRich();
        String s=rr.solve("12345",1);
        Assert.assertEquals("-1",s);
    }


    static String readFile(String path, Charset encoding)
            throws IOException
    {
        byte[] encoded = Files.readAllBytes(Paths.get(path));
        return new String(encoded, encoding);
    }
}
